import React, {Component} from 'react';
import { Link } from 'react-router-dom';


function Signup () {
    return(
        <div className='register-form'>
            <form class='form' action="vendor/signup.php" method='post' enctype='multipart/form-data'>
            <label>Имя:<input type="text" name='first_name'/> </label>
            <label>Фамилия: <input type="text" name='last_name'/> </label>
            <label>Логин: <input type="text" name='login'/> </label>
            <label>Пароль: <input type="password" name='password'/> </label>
            <label>Подтвердите пароль <input type="password" name='password_confirm'/> </label>
            <label>Почта <input type="email" name='email'/> </label>
            <button type='submit' >Зарегестрироваться</button>
            <p>У вас уже есть аккаунт? <Link href="/">Авторизируйтесь</Link></p>
            </form>
        </div>
    )
}

export {Signup}
